// Navbar.tsx

import React, { useState ,lin} from 'react';
// Use Next.js Link for navigation
import './navbar.module.css'; // Import your existing CSS or update as needed

interface NavbarProps {}

const Layout: React.FC<NavbarProps> = () => {
  const [showMenu, setShowMenu] = useState(false);

  const toggleNavbar = () => {
    setShowMenu(!showMenu);
  };

  return (
    <div>
      <nav id="navbar-top" className={`navbar navbar-expand-lg navbar-light bg-white sticky-top ${showMenu ? 'open' : ''}`}>
        <div className="container-fluid px-5">
          <Link href="/" passHref>
            <a className="navbar-brand fw-bold fs-2">DayOut</a>
          </Link>
          <button
            className="nav-menu d-md-none"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarNav"
          >
            <i className="bi bi-menu-button-fill"></i>
          </button>
          <div
            className="collapse navbar-collapse justify-content-center"
            id="navbarNav"
          >
            <ul className="navbar-nav gap-4">
              <li className="nav-item">
                <Link href="/" passHref>
                  <a className="nav-link" aria-current="page">
                    Home
                  </a>
                </Link>
              </li>
              {/* Add other navigation links */}
            </ul>
          </div>
          <Link href="/contact" passHref>
            <a className="c-btn ms-4 py-2 px-4 rounded-pill d-none d-md-block">Contact</a>
          </Link>
          <Link href="/contactList" passHref>
            <a className="c-btn ms-4 py-2 px-4 rounded-pill d-none d-md-block">ContactList</a>
          </Link>
        </div>
      </nav>
    </div>
  );
};

export default Layout;
